const educationReducer = (state = {}, action) => {
    switch (action.payload) {
        case 'ADD_TASK_EDUCATION':
            state = state.concat(action.payload);
            console.log(state);
            break;
        case 'DELETE_TASK_EDUCATION':
            state = state.slice();  
            state.splice(action.payload, 1);
            break;
        default:
            return state;
    }
}

export default educationReducer;
